import React from 'react';

const IconoCheck = () => (
  <svg
    viewBox="0 0 24 24"
    xmlns="http://www.w3.org/2000/svg"
    width="24"
    height="24"
    fill="none"
  >
    <style>
      {`
        @keyframes check {
          to {
            stroke-dashoffset: 0;
          }
        }
      `}
    </style>
    <path
      stroke="#0A0A30"
      strokeLinecap="round"
      strokeWidth="1.5"
      d="M5.387 12.68l3.955 3.956 9.271-9.272"
      style={{
        animation: 'check 2s infinite cubic-bezier(.99,-.1,.01,1.02)',
        strokeDashoffset: 100,
        strokeDasharray: 100,
      }}
    />
  </svg>
);

export {IconoCheck};
